  false,\n\t\"url\": null,\n\t\"notes\": \"The Mexican Mid-winter Waterfowl Survey
  is a continuation of the annual winter waterfowl survey which is conducted in the
  United States and Mexico.   Since the survey's inception in 1947, it has been divided
  into 3 main surveys:  the Gulf Coast, the Interior Highlands, and the Pacific Coast.
  \ Since 1985, the surveys have been run every three years, 2006 being the last.
  \ In the off years, a redhead survey is flown in Laguna Madre on the Gulf Coast
  and a Brant goose survey on the upper (from Mexicali to Cuyutlan on the West Coast
  and from Bahia de Magdalena to San Quintin in the Gulfo de California) part of the
  Pacific Coast.  The Mexican Mid-winter Waterfowl Survey provides wintering habitat
  conditions, waterfowl habitat utilization, waterfowl distribution patterns, and
  general population trends.  The data obtained from this survey is used to manage
  Mexican duck populations and to study the effects of wetland drainage and development.
  \ It is conducted cooperatively by the U.S. Fish and Wildlife Service and Mexican
  officials.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
